import React from 'react';
import { useNavigate } from 'react-router-dom';
import { FaSearch, FaShoppingCart, FaUser } from 'react-icons/fa';
import './Navigation.css';
import bannerImage from '../assets/dd.jpg'; // Import the banner image
import additionalImage from '../assets/additional.jpg'; // New image under the banner
import secondAdditionalImage from '../assets/second_additional.jpg'; // Second image under the additional image

// Import product images
import product1 from '../assets/google.png';
import product2 from '../assets/google.png';
import product3 from '../assets/google.png';
import product4 from '../assets/google.png';
import product5 from '../assets/google.png';
import product6 from '../assets/google.png';

const Navigation = () => {
  const navigate = useNavigate();

  const handleLogout = () => {
    navigate('/'); // Navigate back to sign-up page
  };

  return (
    <>
      <nav className="navbar">
        <div className="nav-left">
          <button className="back-button" onClick={() => navigate(-1)}>‹</button>
          <ul className="nav-links">
            <li><a href="#clothes">Clothes</a></li>
            <li><a href="#gadgets">Gadgets</a></li>
            <li><a href="#new">New</a></li>
            <li><a href="#featured">Featured</a></li>
            <li><a href="#barter">Barter</a></li>
          </ul>
        </div>

        <div className="nav-center">
          <h1>TECHSELL</h1>
        </div>

        <div className="nav-right">
          <button className="icon-button"><FaSearch /></button>
          <button className="icon-button"><FaShoppingCart /></button>
          <button className="icon-button" onClick={handleLogout}><FaUser /></button>
        </div>
      </nav>

      {/* Image below the navigation */}
      <div className="nav-image-container">
        <img src={bannerImage} alt="TechSell Banner" className="nav-banner" />
      </div>

      {/* Additional Image */}
      <div className="additional-image-container">
        <img src={additionalImage} alt="Additional Display" className="additional-banner" />
      </div>

      {/* Second Additional Image */}
      <div className="second-additional-image-container">
        <img src={secondAdditionalImage} alt="Second Additional Display" className="second-additional-banner" />
      </div>

      {/* New Collections Header */}
      <h2 className="new-collections-header">NEW COLLECTIONS</h2>

      {/* Product Grid - 3 in a row */}
      <div className="product-container">
        {[product1, product2, product3, product4, product5, product6].map((product, index) => (
          <div className="product" key={index}>
            <img src={product} alt={`Product ${index + 1}`} />
            <p>Product {index + 1} Description</p>
            <p className="price">GH₵ {450 + index * 100}</p>
          </div>
        ))}
      </div>
    </>
  );
};

export default Navigation;
